    border: 1.5px solid #707070;
    border-radius: 20px;
    box-shadow: 0px 0px #888888;
    justfy-content: space-between;
    padding-left: 12.7px;
    input {
        focus:0;
        border: none;
    }
    .search-icon {
        paddding-top: 6.11px;
        width: 21.49px;
        height: 21.49px;
    }
    `
